export default function PersonalInfos(langague: string) {
    const json = {
        'pt-br': {
            name: 'Fabio Abreu',
            age: '24 anos',
            city: 'Caxias do Sul',
            state: 'Rio Grande do Sul - Brasil'
        },
        'eng': {
            name: 'Fabio Abreu',
            age: '24 years old',
            city: 'Caxias do Sul',
            state: 'Rio Grande do Sul - Brazil'
        }
    };

        if (langague == 'eng') {
            return json['eng'];
        }
        return json['pt-br'];
};
